	[1700] = new Cfg_t_message_s_Info(1701,82001,"0","","野蛮生长的石器时代，开放基础的三消与小飞机玩法。巨石飞舞，霸龙咆哮！快来一场决斗吧！赢取无尽的胜利与宝藏！","","The barbaric growth of the Stone Age, the open foundation of the Three Eliminations and small airplane gameplay Dancing boulders and roaring tyrannosaurs! Come on, let's have a duel! Win endless victories and treasures!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1701] = new Cfg_t_message_s_Info(1702,82002,"0","","激情燃烧的青铜时代，开放一字消玩法。剑拔弩张，大显身手！决斗的号角已经吹响！高举战旗，为了荣耀而战吧！（达到青铜时代后开启）","","The Bronze Age of Passion Burning, Open One Word Elimination gameplay Sword drawn and crossbow drawn, show off your skills! The horn of the duel has sounded! Raise the flag and fight for glory! (Opened after reaching the Bronze Age)","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1702] = new Cfg_t_message_s_Info(1703,82003,"0","","群雄逐鹿的封建时代，开放小炸弹玩法。金戈铁马，正面交锋！激动人心的决斗正向你招手！快来一决胜负吧！（达到封建时代后开启）","","In the feudal era where heroes competed for deer, the game of small bombs was opened up Jin Ge Tie Ma, frontal confrontation! Exciting duel beckoning to you! Come and decide the winner! (Opened after reaching the feudal era)","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1703] = new Cfg_t_message_s_Info(1704,82004,"0","","钢铁轰鸣的工业时代，开放同色消以及组合玩法。强强对决，极限挑战！决斗的舞台光芒绽放，现在就开启你全新的征途！（达到工业时代后开启）","","The industrial era of steel boom, open color fading and combination gameplay Strong duel, ultimate challenge! The stage of the duel shines brightly, now embark on a new journey! (Opened after reaching the industrial age)","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1704] = new Cfg_t_message_s_Info(1705,82005,"0","","繁荣鼎盛的科技时代，所有的玩法都将为您开启！巅峰对决，王者之战! 请尽情享受精彩的决斗盛宴，角逐最强的决斗之王！（达到科技时代后开启）","","In the prosperous era of technology, all gameplay will be opened for you! Peak Battle, Battle of Kings! Please enjoy the exciting duel feast and compete for the strongest duel king! (Opened after reaching the era of technology)","","","","","","","","","","","","","","","","","","","","","","","","","",""),
