	[1775] = new Cfg_t_message_s_Info(1776,210001,"0","","\u3000城堡是领地建造的基础。\n\n\u3000升级城堡，可以提升其他建筑的等级上限。\n\n\u3000它决定着领地的大小和军队成长等全方位潜能。\n\n\u3000城堡的升级，可以为你的领地带来全面提升。\n\n\u3000城堡是统治者权力和文明发展的象征。\n\n\u3000作为文明的引领者，请提升城堡等级，发展领地的潜能。","","\u3000Castle is the foundation upon which a territory is built\n\n\u3000Upgrade the castle to increase the level cap of other buildings\n\n\u3000It determines the size of the territory and the full potential of military growth\n\n\u3000The upgrade of the castle can bring a comprehensive improvement to your territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1776] = new Cfg_t_message_s_Info(1777,210002,"0","","\u3000步兵营是训练步兵的军事建筑。\n\n\u3000升级步兵营，可以提升步兵的属性。\n\n\u3000冲锋陷阵，上战杀敌。\n\n\u3000英勇的步兵们聚集在这里，磨练意志，锤炼身体。\n\n\u3000凭借强壮的体魄，直面艰难挑战与重重危险。\n\n\u3000不论时代的文明，如何发展变化。\n\n\u3000战士们的勇气与热血，永远不会熄灭！","","\u3000The Infantry Battalion is a military structure for training infantry\n\n\u3000Upgrade the infantry battalion, which can improve the attributes of infantry\n\n\u3000Charge into battle and kill the enemy\n\n\u3000The heroic foot soldiers gathered here to hone their will and temper their bodies\n\n\u3000With a strong body, face difficult challenges and dangers","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1777] = new Cfg_t_message_s_Info(1778,210003,"0","","\u3000弓兵营是训练弓兵的军事建筑。\n\n\u3000升级弓兵营，可以提升弓兵的属性。\n\n\u3000百米穿杨，箭无虚发。\n\n\u3000优秀的弓箭手们汇聚于此，磨砺箭术，提升心性。\n\n\u3000磨炼出百发百中的精准，与致命一击的威力。\n\n\u3000虽然战场上的局势，瞬息万变。\n\n\u3000但面对强敌，他们始终保持沉着冷静，射出精准一击！","","\u3000Bow Barracks are military structures for training archers\n\n\u3000Upgrade Bow Barracks to improve the attributes of archers\n\n\u3000100 meters through the poplar, the arrow does not miss\n\n\u3000Excellent archers gather here to sharpen their archery skills and improve their minds！","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1778] = new Cfg_t_message_s_Info(1779,210004,"0","","\u3000骑兵营是训练骑兵的军事建筑。\n\n\u3000升级骑兵营，可以提升骑兵的属性。\n\n\u3000一夫当关，万夫莫敌。\n\n\u3000正义的骑兵们聚集在这里，磨炼战技，挥洒热血！\n\n\u3000锻炼出精湛的骑乘技巧，和勇猛的冲锋战力！\n\n\u3000时代的浪潮汹涌，骁勇善战的骑兵们，也将勇往直前！","","\u3000Cavalry Battalion is a military structure for training cavalry\n\n\u3000Upgrade the cavalry battalion to improve the attributes of the cavalry\n\n\u3000One man can't beat ten thousand men\n\n\u3000The righteous cavalry are gathered here to hone their fighting skills and shed their blood!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1779] = new Cfg_t_message_s_Info(1780,210005,"0","","\u3000接受领主信仰的光之神像，能够决定我方首领的种类。\n\n\u3000神像能够为光辉士兵们提供试炼。\n\n\u3000升级神像，可以提升光辉士兵的属性。\n\n\u3000光之女神见证着，你所有的真诚与勇敢！\n\n\u3000在冒险的旅途中，光之神会陪伴你，踏上梦想的征程。\n\n\u3000天选的勇士，请奉上你的信仰吧！\n\n\u3000神圣的光辉士兵们，会为你带来胜利与宝藏！","","\u3000Accept the Lord's belief in the idol of light, which can determine the type of our leader\n\n\u3000Juggernauts can provide trials for Shining Soldiers\n\n\u3000Upgrade the Juggernaut to increase the attributes of the Shining Soldier\n\n\u3000The goddess of light witnesses all your sincerity and courage!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1780] = new Cfg_t_message_s_Info(1781,210006,"0","","\u3000接受领主献祭的暗之魔像，能够决定我方首领的类型。\n\n\u3000魔像能够为黑暗士兵们提供试炼。\n\n\u3000升级魔像，可以提升黑暗士兵的属性。\n\n\u3000暗之魔神见证着你所有的热血与奋进。\n\n\u3000它会在冒险旅途中协助你，击退一切来犯之敌。\n\n\u3000天选的勇士，请奉上你的献祭吧！\n\n\u3000勇猛的黑暗士兵们，会为你献出力量，挥洒热血。","","\u3000The Dark Golem that receives the Lord's sacrifice can determine the type of our leader\n\n\u3000Golem can provide trials for Dark Soldiers\n\n\u3000Upgrade the Golem to increase the Dark Soldier's stats\n\n\u3000Dark Demon God witnesses all your blood and progress\n\n\u3000It will assist you in your adventures and repel all invading enemies","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1781] = new Cfg_t_message_s_Info(1782,210007,"0","","\u3000农田是生产粮食的场地。\n\n\u3000从石器时代开始，勤劳的子民们就在农田上辛勤播种\n\n\u3000期待粮食的萌芽、生长和丰收。\n\n\u3000无论时代如何变迁，开垦和种植始终是文明发展的基础。\n\n\u3000升级农田，可以提升粮食的产量。\n\n\u3000提升农田的等级，能够解锁更高级别的步兵营。","","\u3000Farmland is a place where food is produced\n\n\u3000Since the Stone Age, industrious people have been sowing seeds on the farmland in anticipation of the germination, growth and harvest of food\n\n\u3000No matter how the times change, reclamation and cultivation are always the basis for the development of civilization","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1782] = new Cfg_t_message_s_Info(1783,210008,"0","","\u3000牧场是生产肉类的场地。\n\n\u3000早在石器文明时期，聪明勤劳的人们就开始了畜牧。\n\n\u3000随着文明的不断发展和科技的进步。\n\n\u3000不曾改变的是对士兵们对大口吃肉的渴望与满足。\n\n\u3000升级牧场，可以提升肉类的产量。\n\n\u3000提升牧场的等级，能够解锁更高级别的骑兵营。","","\u3000a ranch is a place where meat is produced\n\n\u3000As early as the Stone Age, intelligent and industrious people began animal husbandry\n\n\u3000Upgrade the ranch to increase meat production\n\n\u3000Increases the level of the ranch and unlocks a higher level of cavalry battalion","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1783] = new Cfg_t_message_s_Info(1784,210009,"0","","\u3000伐木场是生产木材的场地。\n\n\u3000木材作为生产建设的重要资源，需要大量地消耗使用。\n\n\u3000从广袤森林中采集的树木，在这里进行加工改造。\n\n\u3000由此，自然的馈赠，转换成了有用的生产资源。\n\n\u3000升级伐木场，可以提升木材的产量。\n\n\u3000提升伐木场的等级，能够解锁更高级别的弓兵营。","","\u3000Lumberyards are places where timber is produced\n\n\u3000Wood, as an important resource for production and construction, needs to be consumed and used in large quantities\n\n\u3000Upgrading a lumberyard increases the production of timber\n\n\u3000Increases the level of the Lumberyard and unlocks higher levels of Bow Barracks","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1784] = new Cfg_t_message_s_Info(1785,210010,"0","","\u3000矿场是生产石材的重要场所。\n\n\u3000坚硬的岩石，任凭风雨侵蚀，岁月磨损，百千年不变。\n\n\u3000作为自然的馈赠，在漫长的文明旅程中，显得尤为珍贵。\n\n\u3000升级矿场，可以提升石材的产量。\n\n\u3000提升矿场的等级，能够解锁更高级别的魔像。","","\u3000Mine is an important place for stone production\n\n\u3000Hard rock, despite wind and rain erosion, years of wear and tear, unchanged for hundreds of thousands of years\n\n\u3000Increases the level of the mine and unlocks higher levels of golem","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1785] = new Cfg_t_message_s_Info(1786,210011,"0","","\u3000民房是定时生产银币的建筑。\n\n\u3000民房的变迁，反映着文明的进步与繁荣。\n\n\u3000子民们怀揣着对神明的信仰，见证领地走向繁荣。\n\n\u3000升级民房可以提升银币的产量。\n\n\u3000提升民房的等级，能够解锁更高级别的神象。","","\u3000Civilian houses are buildings that regularly produce silver coins \n\n\u3000The changes of civilian houses reflect the progress and prosperity of civilization \n\n\u3000Upgrading a house can increase the production of silver coins \n\n\u3000Increases the level of the house and unlocks a higher level of the idol","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1786] = new Cfg_t_message_s_Info(1787,210012,"0","","\u3000每日12:00与18:00可以在此获得泉水祝福，领取体力值。\n\n\u3000清澈的泉水中蕴含着神明的祝福，为领地带来新的活力。\n\n\u3000神明一直注视着你的发展，为领地赐予祝福与活力！\n\n\u3000领主大人，请接受泉水的祝福，开创新文明！","","\u3000At 12:00 and 18:00 every day, you can get the spring water blessing here and get the physical strength value\n\n\u3000The clear spring water contains the blessings of the gods, bringing new vitality to the territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1787] = new Cfg_t_message_s_Info(1788,210013,"0","","\u3000仓库是储存资源与道具的场地。\n\n\u3000升级仓库，可以提升存储的最大上限。\n\n\u3000自文明诞生以来，储存资源便不可或缺。\n\n\u3000仓库保护货物免受风吹雨淋和蛀虫侵蚀。\n\n\u3000仓库的容量决定了你可以储存的资源上限。\n\n\u3000聪明的领主大人，请不断升级和扩展你的仓库吧！","","\u3000a warehouse is a place where resources and props are stored\n\n\u3000Upgrade the warehouse to increase the maximum storage limit\n\n\u3000The capacity of the warehouse determines the maximum amount of resources you can store\n\n\u3000Wise Lord, please keep upgrading and expanding your warehouse!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1788] = new Cfg_t_message_s_Info(1789,210014,"0","","\u3000工坊是家具制作所需材料的合成场所。\n\n\u3000升级工坊可以获得更高级的合成配方。\n\n\u3000生产和加工是文明进步的标志。\n\n\u3000工坊将自然中的原材料经过加工，制造为工艺材料。\n\n\u3000这里凝聚着劳动者的智慧，是文明的转折点。\n\n\u3000从封建时代起步，随着生产工具的进步，生产力不断提高。\n\n\u3000请努力提升工坊的产能，为领地带来更好的发展吧！","","\u3000The workshop is a place where the materials needed for furniture are synthesized\n\n\u3000Upgrade Workshop for more advanced synthesis recipes\n\n\u3000Production and processing are signs of civilization and progress\n\n\u3000Workshops process raw materials from nature to craft materials","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1789] = new Cfg_t_message_s_Info(1790,210015,"0","","\u3000城墙是抵御敌人进攻的重要防线。\n\n\u3000升级城墙，可以提升塔防模式下士兵的属性。\n\n\u3000在塔防模式中，城墙是保护领地免受魔兽入侵的关键所在。\n\n\u3000只有不断加固升级城墙，才能抵御住汹涌的魔兽大军。\n\n\u3000城墙如同领地的屏障，为领地提供最强大的安全保障。\n\n\u3000领主大人，请务必重视城墙的建设，保障你的领地安全。","","\u3000Walls are an important line of defense against enemy attacks\n\n\u3000Upgrading the wall can improve the attributes of soldiers in tower defense mode\n\n\u3000In Tower Defense mode, walls are the key to protecting your territory from War craft\n\n\u3000Only by constantly strengthening and upgrading the walls can we resist the surging army of War craft","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1790] = new Cfg_t_message_s_Info(1791,210016,"0","","\u3000在公告板上，你可以查看系统公告与邮件消息。\n\n\u3000系统公告会发布游戏的最新动态。\n\n\u3000包括最新版本介绍、活动预告和机制优化等详情资讯。\n\n\u3000而你的每一封邮件都会保存在邮箱中，欢迎领主随时翻阅！","","\u3000On the bulletin board, you can view system Notices and mail messages\n\n\u3000System Bulletin announces the latest developments in the game\n\n\u3000Includes details of the latest version, event Notices, and mechanism optimizations\n\n\u3000and each of your mail will be saved in the mailbox, welcome to read at any time Lord!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1791] = new Cfg_t_message_s_Info(1792,210017,"0","","\u3000酒馆是英灵们的聚集地。\n\n\u3000升级酒馆，可以提升英灵的等级上限\n\n\u3000盛满美酒的黄金圣杯，吸引众多的英灵汇聚于此。\n\n\u3000充满魔力的美酒，让英灵们变得更加强大。\n\n\u3000英灵们会是你征战世界的得力助手。\n\n\u3000快来酒馆里，与你的英灵伙伴们开怀畅饮吧。\n\n\u3000让更多的英灵，汇集于此，助你一臂之力！","","\u3000The tavern is a gathering place for heroes\n\n\u3000Upgrade the tavern, which can increase the level limit of the spirit \n \n\u3000The golden chalice filled with wine attracts many spirits to gather here\n\n\u3000The magical wine makes the spirits stronger\n\n\u3000Heroes will be your right hand to fight in the world\n\n\u3000Come to the tavern and have a good drink with your fellow heroes","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1792] = new Cfg_t_message_s_Info(1793,210018,"0","","\u3000纪念碑展示领地的等级与成就，为领主提供丰厚的奖励。\n\n\u3000这座丰碑是子民们为你所建造的。\n\n\u3000它记录着你的所有成就，见证着你的付出与奉献！\n\n\u3000随着时代变迁，文明发展。\n\n\u3000在岁月史书中，可以清楚查阅，由你创造的每一个奇迹！","","\u3000Monuments display the ranks and achievements of the domain, providing rich rewards for the Lord\n\n\u3000This monument was built for you by the people\n\n\u3000It records all your achievements and witnesses your efforts and dedication!\n\n\u3000Civilizations develop as times change\n\n\u3000In the history books of the years, you can clearly look up every miracle created by you!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1793] = new Cfg_t_message_s_Info(1794,210019,"0","","\u3000交易所是售卖英灵卡牌的贸易市场。\n\n\u3000在交易所，你可以购买高品质的英灵卡牌。\n\n\u3000每个时代，都会出现独特的英灵卡牌。\n\n\u3000它们不仅象征文明的进步，也是你在战场上取胜的利器。\n\n\u3000自石器文明以来，市场交易便是文明发展的重要组成。\n\n\u3000活跃的贸易，会给文明带来繁荣与活力。\n\n\u3000快来市场看看吧，获取你最心仪的英灵卡牌！","","\u3000The Exchange is a trade market for the sale of Ailing Cards\n\n\u3000At the exchange, you can buy high quality Yearling cards\n\n\u3000In every era, there will be unique Hero cards\n\n\u3000They not only symbolize the progress of civilization, but also are your weapon to win in the battlefield\n\n\u3000Market transactions have been an important part of the development of civilization since the Stone Age\n\n\u3000Active trade will bring prosperity and vitality to civilization\n\n\u3000Come to the market and get your favorite Hero card!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1794] = new Cfg_t_message_s_Info(1795,210020,"0","","可以将你的主城装饰的更加漂亮","","Can decorate your main city more beautifully","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1795] = new Cfg_t_message_s_Info(1796,210021,"0","","可以将你的主城装饰的更加漂亮","","Can decorate your main city more beautifully","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1796] = new Cfg_t_message_s_Info(1797,210022,"0","","\u3000传送门联通着战火浩荡的魔界战场。\n\n\u3000无数凶恶的魔兽，渴望你的到来。\n\n\u3000勇敢的冒险者，请你挺身而出，守护空之岛的和平。\n\n\u3000开启魔界传送门，将进入塔防闯关模式。\n\n\u3000抵御无尽的魔兽大军，挑战防守波数的极限。\n\n\u3000战斗中，可以选择增益效果，提升你的战力。\n\n\u3000完成更高级的防守目标，赢取更丰厚奖励！","","\u3000Bow Barracks are military structures for training archers\n\n\u3000Upgrade Bow Barracks to improve the attributes of archers\n\n\u3000100 meters through the poplar, the arrow does not miss\n\n\u3000Excellent archers gather here to sharpen their archery skills and improve their minds！","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1797] = new Cfg_t_message_s_Info(1798,210023,"0","","\u3000高耸入云的无尽之塔，蕴藏着无数的珍宝。\n\n\u3000它自上而下，连接着各个岛屿。\n\n\u3000自创世神消失后，无尽之塔沦为魔兽的圣地。\n\n\u3000开启无尽之塔，将进入夺宝爬塔模式。\n\n\u3000完成指定的塔层目标，赢取稀有的珍贵宝物。\n\n\u3000每一层关卡，都有特定的增益效果。\n\n\u3000成功通关后，你将获得丰厚的通关奖励。","","\u3000Cavalry Battalion is a military structure for training cavalry\n\n\u3000Upgrade the cavalry battalion to improve the attributes of the cavalry\n\n\u3000One man can't beat ten thousand men\n\n\u3000The righteous cavalry are gathered here to hone their fighting skills and shed their blood!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[1798] = new Cfg_t_message_s_Info(1799,210024,"0","","建筑描述占位","","Building description placeholder","","","","","","","","","","","","","","","","","","","","","","","","","",""),
