	[2847] = new Cfg_t_message_s_Info(2848,3004002,"0","","5消拒马","","5 Eliminate Rejection Horse","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2848] = new Cfg_t_message_s_Info(2849,3100111,"0","","3个充满活力的野牛勇士，它们充满热情和信心。无论面对何种困难，野牛勇士们都会勇往直前！为你开辟前进的道路！","","3 dynamic Buffalo warriors who are full of enthusiasm and confidence No matter what difficulties they face, the Buffalo Warriors will go forward bravely! Open the way for you to move forward!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2849] = new Cfg_t_message_s_Info(2850,3100112,"0","","2个调皮的松鼠投手！爱捣蛋的松鼠投手，擅长远程攻击，能够将敌方击退。身为优秀的射手，只需瞄准目标，就能百发百中！","","Two mischievous squirrel pitchers! Mischievous squirrel pitcher, adept at ranged attacks, able to repel enemies As a good shooter, just aim at the target, you can hit every shot!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2850] = new Cfg_t_message_s_Info(2851,3100113,"0","","3个迅捷灵敏的长弓手。擅长远距离射击敌人。它们的箭矢如同飞火流星，穿透层层防线，给予敌人致命打击！","","Three swift and agile longbowmen Good at shooting enemies from a long distance Their arrows are like flying fireballs, penetrating layers of defense lines and giving the enemy a fatal blow!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2851] = new Cfg_t_message_s_Info(2852,3100114,"0","","一支活泼好动的小精灵战队。这些调皮捣蛋的小精灵，总是齐心协力，携手出击。别看它们个头小小，胆敢小瞧它的敌人一定会陷入巨大麻烦！","","A lively and active team of elves These mischievous elves always work together and attack hand in hand Despite their small size, the enemy who dares to look down on them will be in great trouble!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2852] = new Cfg_t_message_s_Info(2853,3100115,"0","","3个轻装上阵的乌鸦。它们在战场上灵活穿梭，挥舞漆黑的翅膀，嘲讽敌人的软弱。","","Three light ravens They move flexibly on the battlefield, waving their dark wings","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2853] = new Cfg_t_message_s_Info(2854,3100121,"0","","5个威猛的野牛剑士，凭借精湛的剑术和无畏的决心，在战场上勇往直前。快开战吧！铁血的汉子，渴望挥舞长剑，大干一场！","","Five fierce Buffalo swordsmen, with excellent swordsmanship and fearless determination, March forward on the battlefield Let's go to war! Iron-blooded man, eager to wield a sword, a big fight!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2854] = new Cfg_t_message_s_Info(2855,3100122,"0","","3个迅捷灵敏的长弓手。擅长远距离射击敌人。它们的箭矢如同飞火流星，穿透层层防线，给予敌人致命打击！","","Three swift and agile longbowmen Good at shooting enemies from a long distance Their arrows are like flying fireballs, penetrating layers of defense lines and giving the enemy a fatal blow!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2855] = new Cfg_t_message_s_Info(2856,3100123,"0","","2个凶猛的狼游骑兵。它们身穿皮甲，骑乘野狼，飞速穿梭在战场之上。忠诚的狼与勇敢的骑兵积极配合。它们忠于职责，勇敢无畏，剿灭入侵的敌兵。别逃了！等待敌人的只有灭亡！","","Two fierce wolf rangers Wearing leather armor and riding wolves, they flew across the battlefield at high speed Loyal wolves actively cooperate with brave cavalry They are loyal to their duty, brave and fearless, and destroy the invading enemy soldiers Don't run away! Only destruction awaits the enemy!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2856] = new Cfg_t_message_s_Info(2857,3100124,"0","","3个神秘的独角兽。它们挥动着纯白的羽翼，在战场上发起灵活攻势。作为森林的守护者，神秘的独角散发出梦幻之力，让敌方陷入绝境！勇士们，举起武器吧！梦幻的独角兽小队，将为你带来胜利。","","Three mysterious unicorns They waved their pure white wings and launched flexible offensives on the battlefield As the guardian of the forest, the mysterious unicorn radiates the power of fantasy, which makes the enemy in a desperate situation! Warriors, raise your arms! The dream unicorn team will bring you victory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[2857] = new Cfg_t_message_s_Info(2858,3100125,"0","","三个石头人战士，丰饶的大地，赐予它们坚不可摧的身体和顽强的意志。石头人战士喜欢一起作战，彼此间默契十足，共同在战场上大闹一番！","","The three stone warriors, the fertile earth, gave them indestructible bodies and indomitable will Stone soldiers like to fight together, full of tacit understanding between each other, and make a scene together on the battlefield!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
