	[3287] = new Cfg_t_message_s_Info(3288,21010200,"0","","弓弦鸣动，万箭齐发！选定一块区域，释放无数飞箭。锋利的箭雨，能够对敌方造成大范围伤害！小心！不长眼的飞箭，会射中你的屁屁！","","The bow strings will sound, and ten thousand arrows will be fired at once! Select an area and release countless flying arrows.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3288] = new Cfg_t_message_s_Info(3289,21010201,"0","","华丽炫目的电击法术。汹涌的电流，能够对敌人造成小范围伤害，使其陷入短暂眩晕。让敌方在闪亮电光中，体验酥酥麻麻的痛楚！","","Gorgeous and dazzling electric shock spells. The surging current can cause small damage to enemies.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3289] = new Cfg_t_message_s_Info(3290,21010202,"0","","生成一片毒雾沼泽，不幸路过的敌人将受到致命猛毒的折磨。迅猛的毒素不仅能够减缓敌方的速度，还能侵蚀它们的生命力。最终，在痛苦与恐惧中迎来灭亡。","","Generate a Poisonous Mist Swamp, and unfortunately, enemies passing by will be tormented by deadly poison.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3290] = new Cfg_t_message_s_Info(3291,21010203,"0","","从天而降的炙热火球。能够焚烧一小片区域，造成范围伤害。灼烧的烈焰，会将敌人烧得嗷嗷直叫，湮灭于绝望的火海。","","A scorching ball of fire descending from the sky. Can burn a small area and cause range damage.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3291] = new Cfg_t_message_s_Info(3292,21010204,"0","","布满尖刺的巨大滚木，能够击退路径上的敌人，造成范围伤害。狂暴的滚木难以抵挡，弱小的敌人，好好等待被压成肉饼吧！","","A huge rolling wood covered with spikes, capable of repelling enemies on the path and causing range damage.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3292] = new Cfg_t_message_s_Info(3293,21010300,"0","","无敌法术的描述","","Description of Invincible Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3293] = new Cfg_t_message_s_Info(3294,21010301,"0","","狂暴法术的描述","","Description of Berserk Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3294] = new Cfg_t_message_s_Info(3295,21010302,"0","","冰冻法术的描述","","Description of Freeze Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3295] = new Cfg_t_message_s_Info(3296,21010400,"0","","雷电法术的描述","","Description of the Thunder Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3296] = new Cfg_t_message_s_Info(3297,21010401,"0","","禁疗法术的描述","","Description of Forbidden Healing Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3297] = new Cfg_t_message_s_Info(3298,21010402,"0","","治疗法术的描述","","Description of Healing Spell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3298] = new Cfg_t_message_s_Info(3299,21010500,"0","","炮火支援的描述","","Description of Artillery Support","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3299] = new Cfg_t_message_s_Info(3300,21010501,"0","","导弹的描述","","A description of the missile","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3300] = new Cfg_t_message_s_Info(3301,21021110,"0","","3个充满活力的野牛勇士，它们充满热情和信心。无论面对何种困难，野牛勇士们都会勇往直前！为你开辟前进的道路！","","Three energetic bison warriors, full of passion and confidence. No matter what difficulties they face, warriors will move forward bravely!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3301] = new Cfg_t_message_s_Info(3302,21021210,"0","","5个威猛的野牛剑士，凭借精湛的剑术和无畏的决心，在战场上勇往直前。快开战吧！铁血的汉子，渴望挥舞长剑，大干一场！","","Five fierce Buffalo swordsmen, with excellent swordsmanship and fearless determination, March forward on the battlefield！","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3302] = new Cfg_t_message_s_Info(3303,21021310,"0","","野牛盾兵小队的描述","","Description of the Buffalo Shield Team","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3303] = new Cfg_t_message_s_Info(3304,21021410,"0","","火枪手大军的描述","","Description of the Musketeer Army","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3304] = new Cfg_t_message_s_Info(3305,21021510,"0","","现代步兵大队的描述","","Description of a Modern Infantry Battalion","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3305] = new Cfg_t_message_s_Info(3306,21021120,"0","","2个调皮的松鼠投手！爱捣蛋的松鼠投手，擅长远程攻击，能够将敌方击退。身为优秀的射手，只需瞄准目标，就能百发百中！为你带来胜利的曙光！","","Two mischievous squirrel pitchers! A mischievous squirrel pitcher skilled in long-range attacks and able to repel enemies.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3306] = new Cfg_t_message_s_Info(3307,21021220,"0","","3个迅捷灵敏的长弓手。擅长远距离射击敌人。它们的箭矢如同飞火流星，穿透层层防线，给予敌人致命打击！","","Three swift and agile longbowmen Good at shooting enemies from a long distance","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3307] = new Cfg_t_message_s_Info(3308,21021320,"0","","弩手小队的描述","","Description of the crossbowman team","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3308] = new Cfg_t_message_s_Info(3309,21021420,"0","","炮兵大队的描述","","Description of the artillery group","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3309] = new Cfg_t_message_s_Info(3310,21021520,"0","","火箭筒兵小队的描述","","Description of the Rocket Trooper Squad","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3310] = new Cfg_t_message_s_Info(3311,21021130,"0","","3个手持长枪的狼骑兵。它们迅猛无比，能够发起冲锋，快速抵达敌人身前。无论战场形势如何变化，英勇的狼骑兵们都将为你战斗到底！","","Three wolf-troopers armed with pikes They are so swift that they can charge and reach the enemy quickly","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3311] = new Cfg_t_message_s_Info(3312,21021230,"0","","2个凶猛的狼游骑兵。它们身穿皮甲，骑乘野狼，飞速穿梭在战场之上。忠诚的狼与勇敢的骑兵积极配合。它们忠于职责，勇敢无畏，剿灭入侵的敌兵。别逃了！等待敌人的只有灭亡！","","Two fierce wolf rangers. They wear leather armor, ride wild wolves, and quickly shuttle through the battlefield.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3312] = new Cfg_t_message_s_Info(3313,21021330,"0","","长枪骑兵小队的描述","","A description of the Lancers","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3313] = new Cfg_t_message_s_Info(3314,21021430,"0","","龙骑兵小组的描述","","Description of the Dragoon Team","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3314] = new Cfg_t_message_s_Info(3315,21021530,"0","","长刀摩托骑兵大队的描述","","Description of Long Knife Motor Cavalry Battalion","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3315] = new Cfg_t_message_s_Info(3316,21021140,"0","","一支活泼好动的小精灵战队。这些调皮捣蛋的小精灵，总是齐心协力，携手出击。虽然它们个头小小，却有着非凡的实力。小瞧它们的敌人，一定会陷入巨大的麻烦！","","A lively and active team of elves These mischievous elves always work together and attack hand in hand！","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3316] = new Cfg_t_message_s_Info(3317,21021240,"0","","3个神秘的独角兽。它们挥动着纯白的羽翼，在战场上发起灵活攻势。作为森林的守护者，神秘的独角散发出梦幻之力，让敌方陷入绝境！勇士们，举起武器吧！梦幻的独角兽小队，将为你带来胜利。","","Three mysterious unicorns They waved their pure white wings and launched flexible offensives on the battlefield","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3317] = new Cfg_t_message_s_Info(3318,21021340,"0","","小飞龙大队的描述","","Description of the Little Flying Dragon Brigade","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3318] = new Cfg_t_message_s_Info(3319,21021440,"0","","蒸汽小飞龙小组的描述","","Description of Team Steambug","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3319] = new Cfg_t_message_s_Info(3320,21021540,"0","","传教士大队的描述","","Description of the Missionary Battalion","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3320] = new Cfg_t_message_s_Info(3321,21021150,"0","","3个轻装上阵的乌鸦。它们在战场上灵活穿梭，挥舞漆黑的翅膀，嘲讽敌人的软弱。扬起锋利的利爪，撕碎敌人的盔甲。漆黑的乌鸦们穿行于战场，拉开决斗的序幕，哼唱死亡的颂歌！","","Three light ravens They move nimbly on the battlefield, waving their dark wings and mocking the weakness of the enemy !","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3321] = new Cfg_t_message_s_Info(3322,21021250,"0","","三个石头人战士，它们是岛上古老的种族，与坚硬的岩石融为一体。丰饶的大地，赐予它们坚不可摧的身体和顽强的意志。石头人战士喜欢一起作战，彼此间默契十足，共同在战场上大闹一番！","","Three stone warriors, the ancient race of the island, blend in with the hard rock The fertile earth gives them an indestructible body and a strong will Stone soldiers like to fight together, full of tacit understanding between each other, and make a scene together on the battlefield!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3322] = new Cfg_t_message_s_Info(3323,21021350,"0","","骷髅射手小队的描述","","Description of the Skeleton Marksman Team","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3323] = new Cfg_t_message_s_Info(3324,21021450,"0","","迷你死神大队的描述","","Description of the Mini-Death Brigade","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3324] = new Cfg_t_message_s_Info(3325,21021550,"0","","自爆青蛙大队的描述","","Description of the Self-Exploding Frog Brigade","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3325] = new Cfg_t_message_s_Info(3326,21032210,"0","","热血沸腾的穿山甲战士！厚重的铠甲与不屈的意志，使得它们在战场上奋勇前行！勇士们，怒吼吧，战斗吧！见识下穿山甲战士的壮烈豪情吧！","","The Pangolin soldiers with blood boiling! The thick armor and unyielding will make them courageously advance on the battlefield!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3326] = new Cfg_t_message_s_Info(3327,21032310,"0","","旋风战士的描述","","Description of the Tornado Warrior","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3327] = new Cfg_t_message_s_Info(3328,21032410,"0","","巨猿人的描述","","Description of Gigantopithecus","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3328] = new Cfg_t_message_s_Info(3329,21032510,"0","","装甲机枪车的描述","","Description of the armored machine gun vehicle","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3329] = new Cfg_t_message_s_Info(3330,21034210,"0","","勇猛无畏的猛犸象狼骑。它们驾驭着高大的猛犸象，奔驰在战场之上。强壮的身躯和精湛的武艺，使它们在战场上成为不可或缺的力量。","","The fearless Mammoth wolf rides. They drove the tall Mammoth and galloped on the battlefield.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3330] = new Cfg_t_message_s_Info(3331,21034310,"0","","精英长枪骑士的描述","","Description of the Elite Lance Knight","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3331] = new Cfg_t_message_s_Info(3332,21034410,"0","","飞艇的描述","","Description of the airship","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3332] = new Cfg_t_message_s_Info(3333,21034510,"0","","坦克的描述","","Description of the tank","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3333] = new Cfg_t_message_s_Info(3334,21033210,"0","","驰骋沙场的飞斧战士。它可以轻松投掷出飞斧，对敌方造成2次范围伤害。飞斧战士的加入，将为你的战斗，带来更多热血与激情！千万别惹它生气，毕竟斧头可是不长眼的！","","Flying Axe Warriors galloping on the battlefield. It can easily throw a flying axe and deal range damage to enemies.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3334] = new Cfg_t_message_s_Info(3335,21033310,"0","","神箭游侠的描述","","Description of the Arrow Ranger","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3335] = new Cfg_t_message_s_Info(3336,21033410,"0","","狙击手的描述","","The sniper's description","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3336] = new Cfg_t_message_s_Info(3337,21033510,"0","","导弹车的描述","","Description of the missile vehicle","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3337] = new Cfg_t_message_s_Info(3338,21035210,"0","","暴脾气的火龙，它能喷出炽热的火焰，对范围内的敌人造成猛烈伤害。别看它脾气很大，只要能满足它的胃口，暴躁的火龙也会变得乖巧可爱。","","A fiery dragon with a fierce temper, it can emit blazing flames and deal fierce damage to enemies within range.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3338] = new Cfg_t_message_s_Info(3339,21035310,"0","","精灵捕手的描述","","Description of the Elf Catcher","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3339] = new Cfg_t_message_s_Info(3340,21035410,"0","","光明法师的描述","","Description of the Mage of Light","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3340] = new Cfg_t_message_s_Info(3341,21035510,"0","","皇家狮鹫的描述","","Description of the Royal Griffin","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3341] = new Cfg_t_message_s_Info(3342,21036210,"0","","呆呆笨笨的巨大魔像。虽然行动迟缓，却拥有强大的生命力，能够抵挡敌方的猛烈攻势。","","Gawky giant golem Although it is slow, it can withstand the fierce attack of the enemy","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3342] = new Cfg_t_message_s_Info(3343,21036310,"0","","鬼武士的描述","","Description of the Ghost Warrior","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3343] = new Cfg_t_message_s_Info(3344,21036410,"0","","吸血鬼贵族的描述","","Description of Vampire Nobility","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3344] = new Cfg_t_message_s_Info(3345,21036510,"0","","地狱飞龙的描述","","Description of the Flying Dragon of Hell","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3345] = new Cfg_t_message_s_Info(3346,21047210,"0","","这座小屋能够放出野牛勇士。充满热情的它们高举长矛，汹涌而出！现在，快来轰轰烈烈地大闹一场吧！","","The lodge is capable of releasing Buffalo warriors Full of enthusiasm, they hold their spears high and surge out!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3346] = new Cfg_t_message_s_Info(3347,21047220,"0","","这个营地，能够放出长弓手。它们踌躇满志，热情洋溢地在战场上拉弓放箭。好好品尝下，致命箭矢的滋味吧！","","This camp is able to release longbowmen，their bows and arrows on the battlefield Have a good taste of the deadly arrow!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3347] = new Cfg_t_message_s_Info(3348,21047230,"0","","布满尖刺的牢固防线。它可以阻挡敌人的前进，并且反弹敌方的攻击。在激烈的战斗中，拒马将保护你的营地不受伤害，为你争取新的进攻时机！","","A sturdy defense line covered with sharp spikes. It can block the enemy's advance and rebound their attacks.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3348] = new Cfg_t_message_s_Info(3349,21047240,"0","","弓箭塔是战场上的一大利器，能够对远处的敌人发动射击。高大的弓箭塔将瞄准远处的敌人，发射迅捷的箭矢。为你的战斗，带来更多助力！","","The bow and arrow tower is a major weapon on the battlefield, capable of firing at enemies in the distance.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[3349] = new Cfg_t_message_s_Info(3350,21047250,"0","","威力巨大的落石塔，能够朝路过的敌人抛射巨石。战场起，高塔立，巨石飞，敌兵亡！抛飞的落石，会让敌人们脑袋开花！","","The powerful rockfall tower can throw boulders at passing enemies!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
