	[4517] = new Cfg_t_message_s_Info(4518,101000201,"0","","星历8月18日，第193次高空探险，飞空艇遭遇恶劣天气！","","On August 18th of the lunar calendar, during the 193rd high-altitude exploration, the airship encountered bad weather!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4518] = new Cfg_t_message_s_Info(4519,101000202,"0","","糟糕!发动机受损，通讯器失效，仪表盘失灵……只能紧急迫降前方的浮空岛！","","Oh my goodness! Engine damage, instrument panel failure... Can only make an emergency landing on the floating island ahead!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4519] = new Cfg_t_message_s_Info(4520,101000203,"0","","哇哦！飞艇坏了，零件掉了！我迷路了！这座浮空小岛，究竟是什么地方？","","wow！ The airship is broken, the parts are missing! I'm lost! What exactly is this floating island?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4520] = new Cfg_t_message_s_Info(4521,101000204,"0","","我得找回掉落的飞艇零件，将飞艇修好！前面有座吊桥，先过去看看吧！","","I want the airship parts back! There's a drawbridge up ahead. Let's go check it out!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4521] = new Cfg_t_message_s_Info(4522,101000205,"0","","乖乖认输吧！光之女神伊芙琳，远古之岛已被魔神掌控！这座部落注定毁灭，我会踏平你守护的一切！","","Be obedient and give up! The goddess of light, Evelyn, the ancient island has been controlled by the demon god! This tribe is destined to be destroyed, and I will conquer everything you protect!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4522] = new Cfg_t_message_s_Info(4523,101000206,"0","","无耻的魔神爪牙！哪怕消亡在这里，我们也绝不会向魔神屈服！只可惜......我还没等到预言中的冒险者！！","","Shameless Demon God Claw! Even if we perish here, we will never yield to the demon god! Unfortunately I haven't waited for the predicted adventurer yet!!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4523] = new Cfg_t_message_s_Info(4524,101000207,"0","","这里的气氛好奇怪！嗨，美丽的女士，这里发生了什么？","","What a strange atmosphere here! Hey, beautiful lady, what's going on here?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4524] = new Cfg_t_message_s_Info(4525,101000208,"0","","邪恶的魔龙想要毁灭这里！冒险者！请您帮助我，守护这座部落！","","The evil dragon wants to destroy this place! The adventurer! Please help me protect the tribe","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4525] = new Cfg_t_message_s_Info(4526,101000209,"0","","诶...我吗，你确定我能击败这头龙？","","Hey Am I sure I can defeat this dragon?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4526] = new Cfg_t_message_s_Info(4527,101000210,"0","","放心吧，冒险者大人！请您运用我的力量，击退毁灭军团！有了您的加入，我们必将获胜！","","Don't worry, Adventurer! Please use my power to repel the Destroying Legion! With your participation, we will definitely win!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4527] = new Cfg_t_message_s_Info(4528,101000211,"0","","冒险者大人，我的神力凝结在神之符文中！","","Adventurer, my divine power is condensed in the rune of the gods!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4528] = new Cfg_t_message_s_Info(4529,101000212,"0","","让我们移动符文晶石，进行一次消除！","","Let's move the rune crystal and eliminate it once!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4529] = new Cfg_t_message_s_Info(4530,101000213,"0","","让我们将防御塔移动至左侧防御阵地","","Let's move the defense tower to the left defensive position","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4530] = new Cfg_t_message_s_Info(4531,101000214,"0","","太棒了！让我们再合成一次！","","That's great! Let's synthesize again!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4531] = new Cfg_t_message_s_Info(4532,101000215,"0","","让我们将松鼠投手移动至前排防御阵地","","Let's move the squirrel pitcher to the front defensive position","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4532] = new Cfg_t_message_s_Info(4533,101000216,"0","","让我们移动符文晶石，再进行一次消除！","","Let's move the rune crystal and perform another elimination!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4533] = new Cfg_t_message_s_Info(4534,101000217,"0","","让我们将防御塔移动至右侧防御阵地。准备好，敌人要来了！","","Let's move the defense tower to the right defensive position Get ready, the enemy is coming!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4534] = new Cfg_t_message_s_Info(4535,101000218,"0","","不，这不可能！我怎么可能会输？可恶的冒险者！我要让全岛的魔兽都通缉你！等待灭亡的降临吧！","","No, it's impossible! How could I possibly lose? Damn adventurer! I want all the Warcraft on the island to want you! Wait for the arrival of destruction!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4535] = new Cfg_t_message_s_Info(4536,101000219,"0","","天啊，霸王龙带着小兵们逃跑了！可我成了魔兽的通缉犯！飞艇的零件也还散落在这座岛上，这可怎么办？","","Oh, my God! The T-Rex escaped with the minions! But I'm a wanted man of Warcraft! What can we do?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4536] = new Cfg_t_message_s_Info(4537,101000220,"0","","无需担心，冒险者大人！我是光之女神伊芙琳，一定会帮您把飞船的零件都找回来！","","Don't worry, Adventurer! I am Evelyn, the goddess of light, and I will definitely help you find all the parts of the spaceship!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4537] = new Cfg_t_message_s_Info(4538,101000221,"0","","冒险者大人，欢迎来到远古之岛。这里原本是座宁静美丽的小岛，隐藏着古老的遗迹，与众多珍宝。可惜，毁灭军团的入侵，让危险的魔兽，遍布岛屿每个角落。","","Adventurers welcome to the ancient Island. This was originally a peaceful island, but unfortunately, the invasion of the dragon has made the island full of danger","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4538] = new Cfg_t_message_s_Info(4539,101000222,"0","","感谢你的援手！为了报答你的帮助，我决定将这片领地赠送给你。岛屿上有许多友好的氏族，我会让它们帮助你，一同寻找遗失的飞船零件。","","In return for your help, I have decided to present you with this territory. I will ask the elves of the island to help you find the missing ship parts.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4539] = new Cfg_t_message_s_Info(4540,101000223,"0","","现在，让我们先清理石块，用获得的资源，修复部落的主堡吧。","","Now, let's first clean up the stones and use the resources we have obtained to repair the main fortress of the tribe","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4540] = new Cfg_t_message_s_Info(4541,101000224,"0","","双击石块，获得石材","","Double click on the stone to obtain the stone","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4541] = new Cfg_t_message_s_Info(4542,101000225,"0","","非常好！你已经收集到足够的资源，让我们来修复主堡！","","Very good! You have collected enough resources for us to repair the main castle!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4542] = new Cfg_t_message_s_Info(4543,101000226,"0","","主堡建造完成，从现在开始，你就是这里的领主！","","The construction of the main castle is completed, and from now on, you are the lord here!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4543] = new Cfg_t_message_s_Info(4544,101000227,"0","","冒险者，岛屿上遍布危险的魔兽，如果你想找回飞艇零件，就从发展领地，增强实力开始吧！","","Adventurers, the islands are filled with dangerous Warcraft If you want to retrieve airship parts, start by developing your territory and enhancing your strength!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4544] = new Cfg_t_message_s_Info(4545,101000228,"0","","远古之岛拥有丰富的天然资源，我们只需要不断清理，就能够获得资源，拓展领土。","","The ancient island has abundant natural resources, and we only need to constantly clean up to obtain resources and expand our territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4545] = new Cfg_t_message_s_Info(4546,101000229,"0","","救命呀，抢劫啦！谁来救救我！","","Help, there's a robbery! Who will save me!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4546] = new Cfg_t_message_s_Info(4547,101000230,"0","","嘿嘿，小精灵，快把宝物交出来！本大爷可以饶你一命！","","Hey hey, little elf, hand over the treasure quickly! I can spare your life!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4547] = new Cfg_t_message_s_Info(4548,101000231,"0","","可恶！这是到处抢劫的剑齿虎！远古之岛上最常见的坏蛋！请您给它点教训吧！","","Damn it! This is the sabretooth robbing everywhere! The most common villain on the ancient island! Please teach it a lesson!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4548] = new Cfg_t_message_s_Info(4549,101000232,"0","","做得不错，冒险者！继续跟随主线任务前进吧","","Well done, adventurer! Continue to follow the main task and move forward","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4549] = new Cfg_t_message_s_Info(4550,101000233,"0","","冒险者，我们的士兵还在挨饿，现在最重要的是，保障食物供应。充足的食物能吸引新的伙伴加入，帮助你探索整个岛屿。","","Adventurers, our soldiers are still starving, and the most important thing now is to ensure food supply Adequate food can attract new partners and help you explore the entire island","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4550] = new Cfg_t_message_s_Info(4551,101000234,"0","","为了解决饥饿，让我们先建造，能够生产粮食的农田吧。","","To solve hunger, let's first build farmland that can produce food","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4551] = new Cfg_t_message_s_Info(4552,101000235,"0","","做得很好，稳定的食物产出是城市发展的基石，这对我们至关重要。","","Well done, stable food output is the cornerstone of urban development, which is crucial for us","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4552] = new Cfg_t_message_s_Info(4553,101000236,"0","","现在让我们继续进行迷雾的探索吧","","Now let's continue our exploration of fog","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4553] = new Cfg_t_message_s_Info(4554,101000237,"0","","前方的三角龙，挡住了前进的道路。只有先打败它，我们才能继续探索！","","The VelociTriceratops ahead blocked the way forward Only by defeating it first can we continue our exploration!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4554] = new Cfg_t_message_s_Info(4555,101000238,"0","","渺小的蝼蚁们，快把身上的东西，都交出来！否则就尝尝我利爪的滋味吧！","","Tiny ants, quickly hand over all your belongings! Otherwise, taste the taste of my claws!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4555] = new Cfg_t_message_s_Info(4556,101000239,"0","","嚣张的三角龙，想要抢夺我们的资源。冒险者，请带领士兵们迎战！","","The arrogant VelociTriceratops wants to seize our resources Adventurers, please lead the soldiers to battle!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4556] = new Cfg_t_message_s_Info(4557,101000240,"0","","让我们移动棋子，进行一次消除","","Let's move the chess pieces and eliminate them once","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4557] = new Cfg_t_message_s_Info(4558,101000241,"0","","在推图模式中，每一次消除，都会生成一名士兵，帮助我们战胜敌人。","","In the push graphical model mode, each elimination will generate a soldier to help us defeat the enemy","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4558] = new Cfg_t_message_s_Info(4559,101000242,"0","","干得漂亮，冒险者！你以出色的领导力和卓越的智慧，赢得了这场胜利！","","Well done, adventurer! You have won this victory with outstanding leadership and wisdom!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4559] = new Cfg_t_message_s_Info(4560,101000243,"0","","但我们不能掉以轻心，迷雾中隐藏着无数的危险。当你深入探索时，请确保自己拥有足够的实力。","","But we cannot take it lightly, there are countless dangers hidden in the mist When you delve deeper, make sure you have sufficient strength","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4560] = new Cfg_t_message_s_Info(4561,101000244,"0","","冒险者，请跟随任务来发展你的领地吧","","Adventurer, please follow the mission to develop your territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4561] = new Cfg_t_message_s_Info(4562,101000245,"0","","冒险者，前方的魔兽营地，堵住了我们前进的道路！只有打败它们，才能探索岛屿内部！","","Adventurer, the Warcraft Camp ahead is blocking our way forward! Only by defeating them can we explore the interior of the island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4562] = new Cfg_t_message_s_Info(4563,101000246,"0","","怪物营地包含着重重关卡，冒险者，我们需要做好充分的准备，再来挑战 。","","The monster camp contains numerous levels and adventurers, and we need to be fully prepared to challenge again","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4563] = new Cfg_t_message_s_Info(4564,101000247,"0","","为了帮助你，我邀请了牛头人一族，加入你的领地。在它们到来之前，让我们先建造兵营吧！","","To help you, I have invited the Tauren tribe to join your territory Before they arrive, let's build the barracks first!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4564] = new Cfg_t_message_s_Info(4565,101000248,"0","","冒险者大人，步兵营等级的提高，会让我们变得更加强大！","","Adventurer, the improvement of infantry battalion level will make us even stronger!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4565] = new Cfg_t_message_s_Info(4566,101000249,"0","","冒险者，主堡的等级是其他建筑升级的基础 。在升级步兵营之前，让我们先升级主堡吧。","","Adventurer, the level of the main castle is the basis for upgrading other buildings Before upgrading the infantry battalion, let's first upgrade the main castle","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4566] = new Cfg_t_message_s_Info(4567,101000250,"0","","兵营提升至2级，野牛勇士也变得更加强劲了，让我们向怪物营地发动进攻吧！","","The barracks have been upgraded to level 2, and the Buffalo Warriors have become even stronger Let's launch an attack on the monster camp!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4567] = new Cfg_t_message_s_Info(4568,101000251,"0","","冒险者，看见平原上那口破损的泉水了吗？它原是一处被月之神赐福的圣泉，蕴含着祝福的神力。","","Adventurer, have you seen the damaged spring on the plain? It was originally a holy spring blessed by the Moon God, containing the divine power of blessings","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4568] = new Cfg_t_message_s_Info(4569,101000252,"0","","可惜，由于年久失修，祝福泉水被强大的魔兽占领，泉水的神力面临消散的风险。","","Unfortunately, due to prolonged disrepair, the Blessing Spring is occupied by powerful Warcraft, and the spring's divine power is at risk of dissipating","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4569] = new Cfg_t_message_s_Info(4570,101000253,"0","","请你打败占领泉水的魔兽，夺回神圣的祝福泉水！","","Please defeat the Warcraft that occupies the Spring and retrieve the Holy Blessing Spring!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4570] = new Cfg_t_message_s_Info(4571,101000254,"0","","太棒了，冒险者！祝福泉水的力量，能够为您的军队带来新的活力！","","Great, adventurer! Blessing the power of spring water, it can bring new vitality to your army!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4571] = new Cfg_t_message_s_Info(4572,101000255,"0","","每天中午的12:00与晚上的18:00，您都可以来这里领取新的祝福泉水。","","Every day at 12:00 noon and 18:00 in the evening, you can come here to receive new blessings from the spring water","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4572] = new Cfg_t_message_s_Info(4573,101000256,"0","","是谁活得不耐烦了？胆敢溜进我的花园，觊觎我的宝藏！","","Who is living impatiently? Dare to sneak into my garden and covet my treasure!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4573] = new Cfg_t_message_s_Info(4574,101000257,"0","","快看！我的飞艇发动机，就在飞龙的宝箱里。我一定要把它夺回来！","","Look! My airship engine is in the treasure chest of the pterosaur I must take it back!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4574] = new Cfg_t_message_s_Info(4575,101000258,"0","","胆大妄为的闯入者，竟敢觊觎我的宝藏！留下做我的晚餐吧！","","The bold intruder dares to covet my treasure! Stay and make my dinner!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4575] = new Cfg_t_message_s_Info(4576,101000259,"0","","冒险者，想要击败在空中盘旋的飞龙，我们需要派遣，能够远程攻击的士兵！","","Adventurers, in order to defeat pterosaurs hovering in the air, we need to dispatch soldiers who can attack remotely!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4576] = new Cfg_t_message_s_Info(4577,101000260,"0","","让我出战吧！冒险者大人，我的弹弓能够打击远处的敌人，看我把飞龙射下来做烧烤！","","Let me fight! Adventurer, my slingshot can strike enemies in the distance Watch me shoot down pterosaurs for barbecue!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4577] = new Cfg_t_message_s_Info(4578,101000261,"0","","无知的冒险者，留下做我的下午茶吧！","","Ignorant adventurer, stay and make my afternoon tea!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4578] = new Cfg_t_message_s_Info(4579,101000262,"0","","别打了，求你快停下！别打我了！这块破铁疙瘩你拿去吧！还有这些宝藏都归你了。","","Stop fighting, please stop! Don't hit me! Take this broken iron lump! And all these treasures belong to you","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4579] = new Cfg_t_message_s_Info(4580,101000263,"0","","太好了！这是飞艇的发动机，总算拿回来了！看来其余的飞艇零件，一定散落在岛屿的更深处！","","That's great! This is the engine of the airship, I finally found it! The rest of the airship parts must have been scattered even deeper on the island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4580] = new Cfg_t_message_s_Info(4581,101000264,"0","","冒险者大人，恭喜您出色地战胜了飞龙，快来看看这次的收获吧！","","Adventurer, congratulations on your outstanding victory over the pterosaur. Come and take a look at this harvest!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4581] = new Cfg_t_message_s_Info(4582,101000265,"0","","太棒了，真是一次大丰收！我们需要建造1个仓库，扩大领地的存储上限，避免资源浪费。","","It's really a big harvest. We need to build a warehouse to expand the storage limit of the territory and avoid resource waste.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4582] = new Cfg_t_message_s_Info(4583,101000266,"0","","一旦攻破这个营地，我们就能进入岛屿更深处。希望您能寻找到飞艇零件的下落。","","Once we break through this camp, we can enter deeper into the island I hope you can find the whereabouts of the airship parts","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4583] = new Cfg_t_message_s_Info(4584,101000267,"0","","真不愧是毁灭军团，即使是一座小小的营地，要取得胜利也并不容易!","","It truly deserves to be the Destroying Legion, even a small camp, winning is not easy!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4584] = new Cfg_t_message_s_Info(4585,101000268,"0","","冒险者大人，不必担心！我们可以先对领地进行建设，提升实力后，再继续探索。","","Adventurer, don't worry! We can first build the territory and enhance our strength before continuing to explore","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4585] = new Cfg_t_message_s_Info(4586,101000269,"0","","随着领地的壮大，岛屿上强大的“英灵”将协助我们一起对抗敌人。","","As the territory grows, the powerful \"heroes\" on the island will assist us in confronting the enemy together","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4586] = new Cfg_t_message_s_Info(4587,101000270,"0","","英灵们拥有独特的技能和强大实力，能够在战场上为你冲锋陷阵！","","The heroes possess unique skills and powerful strength, able to charge you on the battlefield!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4587] = new Cfg_t_message_s_Info(4588,101000271,"0","","我们也可以通过商店购买，获得更多的“英灵”与“军队”","","We can also purchase more \"heroes\" and \"armies\" through stores","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4588] = new Cfg_t_message_s_Info(4589,101000272,"0","","我们可以在领地中建造“酒馆”了，酒馆的等级决定了“英灵”的等级上限。","","We can now build a \"tavern\" in the territory, and the level of the tavern determines the upper limit of the \"spirit\" level","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4589] = new Cfg_t_message_s_Info(4590,101000273,"0","","只有先提升酒馆的等级，才能进行“英灵”的强化","","Only by elevating the level of the tavern can we strengthen the 'spirit'","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4590] = new Cfg_t_message_s_Info(4591,101000274,"0","","冒险者，探险的旅途总是充满惊喜！现在，让我为你开启精彩的超值活动吧！","","Adventurers, the journey of exploration is always full of surprises! Now, let me start a wonderful and valuable activity for you!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4591] = new Cfg_t_message_s_Info(4592,101000275,"0","","民房的修建，为领地带来了更多人口。我感受到了子民的信仰，现在我们可以建造神像了。","","The construction of residential houses has brought more population to the territory I feel the faith of the people, and now we can build statues","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4592] = new Cfg_t_message_s_Info(4593,101000276,"0","","当我们在战场上进行消除时，神像能激发我，释放更强大的技能。","","When we eliminate on the battlefield, the idol can inspire me and unleash stronger skills","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4593] = new Cfg_t_message_s_Info(4594,101000277,"0","","冒险者，神像的具体效果，还需要你来探索。期待你运用光辉的力量，将领地发展得更加强盛。","","The specific effects of adventurers and statues still require you to explore I look forward to using your glorious power to develop your territory even stronger","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4594] = new Cfg_t_message_s_Info(4595,101000278,"0","","现在我们拥有了稳定的矿石产出，可以修建暗之神像了。","","Now that we have stable ore production, we can build the Dark God statue","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4595] = new Cfg_t_message_s_Info(4596,101000279,"0","","暗夜之神是一位强大的神祇。修建暗之神像，可以召唤他的降临！ 相信他的力量，将为领地带来巨大的提升。","","The Night God is a powerful deity Build the Dark God statue to summon his arrival! Believe in his power and it will bring great improvement to the territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4596] = new Cfg_t_message_s_Info(4597,101000280,"0","","...我已经沉睡了多久？光之女神伊蕾娜，真是久违的重逢啊！","","How long have I been sleeping? Irina, the goddess of light, what a long lost reunion!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4597] = new Cfg_t_message_s_Info(4598,101000281,"0","","好久不见，暗夜之神维尔德！介绍一下我的伙伴。这是冒险者，我们部落的新领主。","","Long time no see, Dark Night God Wilder! Introduce my partner This is the adventurer, the new lord of our tribe","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4598] = new Cfg_t_message_s_Info(4599,101000282,"0","","你就是为我修建暗之神像的小家伙吧！感谢你的唤醒，让我得以重见天日！","","Are you the little guy who built the Dark God statue for me! Thank you for awakening me and allowing me to see the light of day again!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4599] = new Cfg_t_message_s_Info(4600,101000283,"0","","您好，暗夜之神，我在这座岛屿上，遭遇了很多麻烦。希望得到你的帮助！","","Hello, Night God, I have encountered a lot of trouble on this island I hope to receive your help!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4600] = new Cfg_t_message_s_Info(4601,101000284,"0","","哈哈哈，没问题！只要你不断建设暗之神像，我就能够为你提供各种帮助！","","Hahaha, no problem! As long as you continue to build the Dark God statue, I can provide you with all kinds of help!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4601] = new Cfg_t_message_s_Info(4602,101000285,"0","","如果你选择供奉魔像，我将率领魔兵，代替女神为你而战，战胜一切来犯之敌！","","If you choose to worship the demon statue, I will lead the demon army to fight for you instead of the goddess, defeating all incoming enemies!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4602] = new Cfg_t_message_s_Info(4603,101000286,"0","","魔像的更多功能，需要你不断升级探索。冒险者，我很期待你能掌握黑暗的力量！","","The more functions of the magic image require you to constantly upgrade and explore Adventurer, I am looking forward to you mastering the power of darkness!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4603] = new Cfg_t_message_s_Info(4604,101000287,"0","","哼，哪来的小老鼠？胆敢擅闯奥森禁地，真是不知死活！","","Hmm, where did the little mouse come from? Dare to trespass on the Mammoth Forbidden Area, you really don't know what to do!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4604] = new Cfg_t_message_s_Info(4605,101000288,"0","","剑齿虎奥森，我是寻找飞艇零件的冒险者，如果你能将它归还，我将感激不尽。","","Raymonton, I am an adventurer searching for airship parts If you could return it, I would greatly appreciate it","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4605] = new Cfg_t_message_s_Info(4606,101000289,"0","","别做梦了，这可是人马之王赏赐我的宝贝！愚蠢的冒险者，灭亡在我的利刃下吧！","","Don't dream, this is the treasure bestowed on me by the King of Man and Horse! Foolish adventurer, perish under my iron hooves!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4606] = new Cfg_t_message_s_Info(4607,101000290,"0","","啊！可恶的冒险者，求求你别打了。我认输！飞艇零件还给你！还有我的宝贝们，都归你了！","","Ah! Damn adventurer, please don't fight I give up! Return the airship parts to you! And my babies, it's all yours!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4607] = new Cfg_t_message_s_Info(4608,101000291,"0","","给我老实点！快说！人马之王在哪里？它的手里一定还有其他的飞艇零件！","","Be honest with me! Speak up! Where is the King of Man and Horse? It must have other airship parts in its hand!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4608] = new Cfg_t_message_s_Info(4609,101000292,"0","","别打我了! 人马之王就在西北方的酋长岭，它的力量十分强大，你们一定会失败的！","","Don't hit me! The King of Man and Horse is located in the Chieftain Ridge in the northwest, and its power is very powerful You will definitely fail!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4609] = new Cfg_t_message_s_Info(4610,101000293,"0","","冒险者，感谢你的努力！随着魔像的等级提升，我将为你开启更多的功能。","","Adventurer, thank you for your efforts! As the level of the magic image increases, I will enable more functions for you","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4610] = new Cfg_t_message_s_Info(4611,101000294,"0","","现在你可以通过魔像，献祭你不需要的“英灵”，获得贪婪货币。","","Now you can obtain greedy currency by sacrificing \"heroes\" you don't need through magic statues","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4611] = new Cfg_t_message_s_Info(4612,101000295,"0","","在贪婪商店中，你可以用贪婪货币，购买珍贵的物品。亲爱的冒险者，祝你购物愉快！","","In a greedy store, you can use greedy currency to purchase precious items Dear adventurer, have a pleasant shopping experience!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4612] = new Cfg_t_message_s_Info(4613,101000296,"0","","渺小的蝼蚁，竟敢擅闯我雷龙亚兹的领地！为你的愚蠢付出代价吧！","","Tiny mole ant, how dare you trespass on my territory of Thunder Dragon Az! Pay the price for your foolishness!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4613] = new Cfg_t_message_s_Info(4614,101000297,"0","","雷龙亚兹，我不仅要夺回飞艇零件，还要惩治你这只四处作乱的恶龙!","","Rayonaz, I not only want to retrieve the parts of the airship, but also to punish you, this mischievous dragon!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4614] = new Cfg_t_message_s_Info(4615,101000298,"0","","哈哈哈，狂妄的冒险者，就凭你也配教训我！ 等待绝望的降临吧","","Hahaha, arrogant adventurer, even you deserve to teach me a lesson! Wait for the arrival of despair","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4615] = new Cfg_t_message_s_Info(4616,101000299,"0","","可恶的冒险者，别嚣张！你的飞艇零件，早已被我们瓜分殆尽！","","Damn adventurer, don't be arrogant! Your airship parts have already been completely divided by us!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4616] = new Cfg_t_message_s_Info(4617,101000300,"0","","巴提尔大人，一定会为我讨回公道！等着吧，我将亲眼见证你的灭亡！","","Lord Battier, you will definitely seek justice for me! Wait, I will witness your destruction with my own eyes!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4617] = new Cfg_t_message_s_Info(4618,101000301,"0","","终于拿回了通讯联络器！通过它，我们可以与外界的冒险者，进行模拟练习与决斗对战！","","Finally retrieved the communication device! Through it, we can engage in simulation exercises and duel battles with external adventurers!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4618] = new Cfg_t_message_s_Info(4619,101000302,"0","","太好了，这真是个神奇的装置！让我们来试一试吧！","","Great, this is really a magical device! Let's give it a try!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4619] = new Cfg_t_message_s_Info(4620,101000303,"0","","点击战场","","Click on the battlefield","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4620] = new Cfg_t_message_s_Info(4621,101000304,"0","","点击练习场，这里是练习对战技巧的场地，免费向所有冒险者开放！","","Click on the training ground, this is the place to practice combat skills, open to all adventurers for free!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4621] = new Cfg_t_message_s_Info(4622,101000305,"0","","选择石器时代，随着文明的升级，还会开放更高级别的赛场。","","Choosing the Stone Age, with the upgrading of civilization, higher level venues will also be opened","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4622] = new Cfg_t_message_s_Info(4623,101000306,"0","","点击卡牌编队","","Click on card formation","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4623] = new Cfg_t_message_s_Info(4624,101000307,"0","","在PVP的战斗中，所有冒险者的卡牌等级都是一致的，现在，请编辑你的战队吧！","","In PVP battles, all adventurers have the same card level Now, please edit your team!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4624] = new Cfg_t_message_s_Info(4625,101000308,"0","","加油吧，冒险者！让我们开启一场1v1的挑战，展现你的实力！","","Come on, adventurer! Let's embark on a 1v1 challenge and showcase your strength!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4625] = new Cfg_t_message_s_Info(4626,101000309,"0","","恭喜你获得胜利！亲爱的冒险者，请尽情享受决斗带来的乐趣吧！","","Congratulations on your victory! Dear adventurer, please enjoy the fun of dueling to the fullest!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4626] = new Cfg_t_message_s_Info(4627,101000310,"0","","点击“英灵”头像，将其部署在队伍中","","Click on the 'Spirit' avatar to deploy it in the team","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4627] = new Cfg_t_message_s_Info(4628,101000311,"0","","升级时间小于5分钟，点击“免费升级”，可以直接完成。","","If the upgrade time is less than 5 minutes, click on \"Free Upgrade\" to complete it directly","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4628] = new Cfg_t_message_s_Info(4629,101000312,"0","","点击主堡废墟，进行修理","","Click on the ruins of the main castle to repair it","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4629] = new Cfg_t_message_s_Info(4630,101000313,"0","","双击“倒塌的树木”，清理通道","","Double click on 'Collapsed Trees' to clear the passage","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4630] = new Cfg_t_message_s_Info(4631,101000314,"0","","点击任务栏，领取主线任务奖励","","Click the taskbar to receive the main line task reward","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4631] = new Cfg_t_message_s_Info(4632,101000315,"0","","点击“建造”按钮","","Click on the 'Build' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4632] = new Cfg_t_message_s_Info(4633,101000316,"0","","点击“农田”","","Click on 'Farmland'","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4633] = new Cfg_t_message_s_Info(4634,101000317,"0","","点击“建造”，开始建设","","Click on 'Build' to start construction","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4634] = new Cfg_t_message_s_Info(4635,101000318,"0","","点击“剑齿虎”","","Click on 'sabretooth'","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4635] = new Cfg_t_message_s_Info(4636,101000319,"0","","点击“战斗”按钮","","Click on the 'Battle' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4636] = new Cfg_t_message_s_Info(4637,101000320,"0","","哇咔咔，别再打了，冒险者大人！我们知错了，恳请您的宽恕！","","Wow, stop fighting, Adventurer! We acknowledge our mistake and earnestly request your forgiveness!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4637] = new Cfg_t_message_s_Info(4638,101000321,"0","","你们聚集在这里，究竟是想做什么？","","What exactly do you want to do when you gather here?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4638] = new Cfg_t_message_s_Info(4639,101000322,"0","","冒险者大人，我们正在为通天塔欢庆呢。通天塔就在前方，那是我们的圣地，蕴藏着无数宝藏！","","Adventurer, we are celebrating the Tongtian Tower The Tongtian Tower is right ahead, it is our holy land, containing countless treasures!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4639] = new Cfg_t_message_s_Info(4640,101000323,"0","","通天塔曾经是连接整个空之岛的圣塔，从远古之岛延伸至天空岛的最高层，每一层塔都保存着珍贵的宝物。","","The Tongtian Tower used to be the holy tower connecting the entire Sky Island, extending from the ancient island to the highest level of Sky Island, with each layer of tower preserving precious treasures","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4640] = new Cfg_t_message_s_Info(4641,101000324,"0","","自从最高神消失之后，泛滥的魔兽们，便占据了通天塔。只要你能战胜塔中的魔兽，便能获得众多珍宝。","","Since the disappearance of the Supreme God, the rampant monsters have occupied the Tower of Heaven As long as you can defeat the Warcraft in the tower, you can obtain numerous treasures","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4641] = new Cfg_t_message_s_Info(4642,101000325,"0","","现在，让我们进入通天塔的第一层，一探究竟吧。","","Now, let's enter the first floor of the Tongtian Tower and explore","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4642] = new Cfg_t_message_s_Info(4643,101000326,"0","","哪里来的无名之辈，胆敢踏入我的领地！","","Where do you come from, an unknown person, dare to step into my territory!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4643] = new Cfg_t_message_s_Info(4644,101000327,"0","","人马之王，我是外来的冒险者。我的飞艇零件不慎落入你的领地，你可否将它归还给我？","","King of Man and Horse, I am an outsider adventurer My airship parts accidentally fell into your territory Can you return them to me?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4644] = new Cfg_t_message_s_Info(4645,101000328,"0","","当然可以，不过这东西价值不菲。除非你能打败我，否则就拿你的自由来交换吧！","","Of course, but this thing is valuable Unless you can defeat me, exchange your freedom!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4645] = new Cfg_t_message_s_Info(4646,101000329,"0","","你输了，人马之王！","","You lost, the king of men and horses!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4646] = new Cfg_t_message_s_Info(4647,101000330,"0","","哼，没想到你的力量如此强大！这块飞艇零件你拿去吧。顺便提醒你们，霸王龙巴尔正与魔界勾结，它们不会放过你的！","","Humph, I didn't expect your power to be so powerful! Take this airship component with you By the way, I would like to remind you that Tyrannosaurus Rex Barr is colluding with the Demon Realm and they will not let you go!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4647] = new Cfg_t_message_s_Info(4648,101000331,"0","","太好了冒险者，恭喜你战胜了人马之王！为了应对以后的危机，让我们先来升级领地吧！","","Great adventurer, congratulations on defeating the King of Man and Horse! In order to cope with future crises, let's first upgrade our territory!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4648] = new Cfg_t_message_s_Info(4649,101000332,"0","","随着主堡等级的提升，你可以在领地上修建纪念碑了。纪念碑承载着子民对你的感激，记录着你的所有成就与壮举。","","With the improvement of the main castle level, you can build a monument on your territory The monument carries the gratitude of the people to you and records all your achievements and feats","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4649] = new Cfg_t_message_s_Info(4650,101000333,"0","","在纪念碑前，你可以领取丰厚的奖励。你所完成的挑战，与领地的发展过程，都会铭记于此。","","In front of the monument, you can receive generous rewards The challenges you have completed and the development process of your territory will be remembered here","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4650] = new Cfg_t_message_s_Info(4651,101000334,"0","","不好，我感受到了强烈的波动！发狂的魔兽们正聚集在一起。","","Not good, I feel strong fluctuations! Crazy monsters are gathering together","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4651] = new Cfg_t_message_s_Info(4652,101000335,"0","","这些魔兽很不对劲，赶快打败它们吧！","","These Warcraft beasts are not right Hurry up and defeat them!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4652] = new Cfg_t_message_s_Info(4653,101000336,"0","","冒险者，你们别得意！魔界之门已经展开，这座岛屿一定会被魔族征服！","","Adventurers, don't be complacent! The Gate of the Demon Realm has opened, and this island will definitely be conquered by the Demon Clan!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4653] = new Cfg_t_message_s_Info(4654,101000337,"0","","糟糕，魔族大军正通过魔界之门，入侵空之岛！冒险者，请你务必阻止它们！","","Oops, the Demon Clan army is invading the Empty Island through the Gate of the Demon Realm! Adventurers, please make sure to stop them!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4654] = new Cfg_t_message_s_Info(4655,101000338,"0","","微不足道的蝼蚁，无尽的魔界大军，会将你们吞噬殆尽！","","The insignificant mole ant, the endless army of the demon world, will devour you all!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4655] = new Cfg_t_message_s_Info(4656,101000339,"0","","冒险者，迎战吧！魔界的大门已经打开，远古之岛岌岌可危，请你守护这座岛屿！","","Adventurers, let's face it! The gate of the demon world has been opened, and the ancient island is in danger Please protect this island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4656] = new Cfg_t_message_s_Info(4657,101000340,"0","","可恶，我竟然会败在你的手中！冒险者，别高兴得太早！即使我失败了，源源不断的魔界大军也将占领这座岛屿！","","Damn it, I should have been defeated by you! Adventurer, don't be too happy too early! Even if I fail, the endless army of the demon world will still occupy this island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4657] = new Cfg_t_message_s_Info(4658,101000341,"0","","冒险者，我们必须阻止魔界的阴谋，绝不能让它们得逞","","Adventurers, we must stop the conspiracies of the demon world and never let them succeed","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4658] = new Cfg_t_message_s_Info(4659,101000342,"0","","冒险者，为了保卫空之岛，你可以进入魔界之门，与魔界大军展开战斗。","","Adventurer, in order to defend the Empty Island, you can enter the Gate of the Demon Realm and engage in battle with the Demon Realm army","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4659] = new Cfg_t_message_s_Info(4660,101000343,"0","","魔界中蕴含着大量的财富，也存在着巨大的危险。请你一定要做好充分的准备！","","There is a wealth and great danger in the demon world Please be fully prepared!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4660] = new Cfg_t_message_s_Info(4661,101000344,"0","","接下来，让我们立即行动，击退入侵的魔族吧！","","Next, let's take immediate action to repel the invading Demon Clan!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4661] = new Cfg_t_message_s_Info(4662,101000345,"0","","干得漂亮！恭喜你成功抵挡住了，魔界的第一波入侵。然而，魔族军队十分强大，如果想要继续深入，你还需要提升实力。","","Well done! Congratulations on successfully resisting the first wave of invasion in the demon world However, the demon army is very powerful, and if you want to continue deepening, you still need to improve your strength","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4662] = new Cfg_t_message_s_Info(4663,101000346,"0","","如今魔界的气息，导致岛上的魔兽变得更加狂躁。冒险者，请你加快对岛屿的探索，唯有打败霸王龙巴尔，我们才能解决这场危机！","","Nowadays, the aura of the demon world has caused the monsters on the island to become even more manic Adventurer, please accelerate your exploration of the island Only by defeating Tyrannosaurus Rex Barr can we solve this crisis!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4663] = new Cfg_t_message_s_Info(4664,101000347,"0","","嘿，新来的冒险者。你看起来真可爱，留下来给我们当玩具吧！","","Hey, new adventurer You look so cute, stay and make us toys!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4664] = new Cfg_t_message_s_Info(4665,101000348,"0","","这帮魔兽太嚣张了，快好好教训他们一顿！","","These monsters are too arrogant, give them a good lesson!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4665] = new Cfg_t_message_s_Info(4666,101000349,"0","","都给我老实点！快说，你们见过我的飞艇零件吗？","","Be honest with me! Come on, have you seen my airship parts?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4666] = new Cfg_t_message_s_Info(4667,101000350,"0","","哎哟，别打我了。那些从天而降的大铁块，就在前方的魔兽营地。你有本事就去拿吧！","","Ouch, don't hit me anymore The large iron blocks falling from the sky are right in front of the Warcraft Camp If you have the ability, go and get it!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4667] = new Cfg_t_message_s_Info(4668,101000351,"0","","大胆的冒险者！竟然敢踏足此地！大家一起上，绑了他交给巴尔大人！","","Bold adventurer! How dare you step into this place! Everyone up together, tie him up and hand him over to Lord Barr!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4668] = new Cfg_t_message_s_Info(4669,101000352,"0","","无耻的魔兽，快把我的飞艇零件交出来！","","Shameless Warcraft, hand over my airship parts quickly!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4669] = new Cfg_t_message_s_Info(4670,101000353,"0","","哼，拿去吧。不过是块从天而降的大铁片，能有什么用？","","Humph, take it It's just a big piece of iron falling from the sky, what's the use of it?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4670] = new Cfg_t_message_s_Info(4671,101000354,"0","","别狂妄了，冒险者！前方就是霸王龙氏族的领地。巴尔首领强大无比，你注定会失败！","","Don't be arrogant, adventurer! Ahead is the territory of the Tyrannosaurus Rex clan Boss Ba is incredibly powerful, you are destined to fail!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4671] = new Cfg_t_message_s_Info(4672,101000355,"0","","冒险者，你已经将领地发展到石器时代的巅峰。你的名字在远古之岛上广为传颂。各个氏族都渴望与你交流，得到你的帮助。","","Adventurer, you have developed your territory to the peak of the Stone Age Your name is widely spread on the ancient island All clans are eager to communicate with you and receive your help","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4672] = new Cfg_t_message_s_Info(4673,101000356,"0","","现在，我将为你开启随机事件，希望能够为你带来更多的资源和成长。","","Now, I will activate random events for you, hoping to bring you more resources and growth","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4673] = new Cfg_t_message_s_Info(4674,101000357,"0","","想要打败霸王龙巴尔，需要先剿灭它的军队。让我们先攻破周围的魔兽营地，削弱霸王龙的力量，为最终的决战做好准备！","","To defeat the Tyrannosaurus Rex, one needs to first annihilate its army Let's first break through the surrounding Warcraft camps, weaken the power of Tyrannosaurus Rex, and prepare for the final battle!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4674] = new Cfg_t_message_s_Info(4675,101000358,"0","","可恶的冒险者，巴尔大人联合了魔界的力量，已经准备好天罗地网，你们注定要失败！","","Damned adventurer, Lord Barr has joined forces with the power of the demon world and is ready to be caught in a trap You are destined to fail!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4675] = new Cfg_t_message_s_Info(4676,101000359,"0","","渺小的冒险者，竟敢自投罗网！我必将撕碎你们，彻底征服远古之岛！","","Little adventurer, how dare you fall into the trap! I will tear you apart and completely conquer the ancient island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4676] = new Cfg_t_message_s_Info(4677,101000360,"0","","迎战吧，冒险者！胜利已经近在眼前，你一定能够守护空之岛的和平与尊严！","","Let's face it, adventurer! Victory is already in sight, and you must be able to protect the peace and dignity of the Island of Void!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4677] = new Cfg_t_message_s_Info(4678,101000361,"0","","认输吧，冒险者！无论你如何挣扎，都将迎来终结！","","Give up, adventurer! No matter how hard you struggle, you will come to an end!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4678] = new Cfg_t_message_s_Info(4679,101000362,"0","","别做梦了，我一定会亲手打败你！","","Don't dream, I will definitely defeat you with my own hands!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4679] = new Cfg_t_message_s_Info(4680,101000363,"0","","冒险者，请全力以赴！光明与黑暗的双神将协助你，赢得这场决战！","","Adventurers, please do your best! The twin gods of light and darkness will assist you in winning this decisive battle!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4680] = new Cfg_t_message_s_Info(4681,101000364,"0","","尽皆毁灭吧！本王已融合魔界的力量，你们必将灭亡！","","Destroy everything! This king has merged the power of the demon world, and you will surely perish!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4681] = new Cfg_t_message_s_Info(4682,101000365,"0","","啊，本王的头好晕！我.....究竟做了些什么，为何会在这里？","","Ah, my king's head is so dizzy! I What have you done and why are you here?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4682] = new Cfg_t_message_s_Info(4683,101000366,"0","","别装蒜了，巴尔。无论你在盘算什么，我们都会战胜你！","","Stop pretending, Bal No matter what you are thinking, we will defeat you!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4683] = new Cfg_t_message_s_Info(4684,101000367,"0","","冒险者，请等一下！它身上的魔气消失了。霸王龙巴尔曾是远古之岛的守护者。它深受魔界的侵蚀，是你的力量唤醒了它。","","Adventurer, please wait! The magic energy on it has disappeared Tyrannosaurus Rex was once the guardian of the ancient island It was deeply eroded by the demon world, and it was your power that awakened it","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4684] = new Cfg_t_message_s_Info(4685,101000368,"0","","唉，尊敬的冒险者，当初我为了追求力量，被魔界所蛊惑，给远古之岛带来了无尽的战乱，为此我深感羞愧。","","Alas, respected adventurer, I was once deceived by the demon world in pursuit of power and brought endless war to the ancient island I am deeply ashamed of this","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4685] = new Cfg_t_message_s_Info(4686,101000369,"0","","冒险者，感谢你拯救了远古之岛。为了表达我的歉意，这些宝物和飞艇零件都交给你吧。","","Adventurer, thank you for saving the ancient island To express my apologies, let me hand over these treasures and airship parts to you","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4686] = new Cfg_t_message_s_Info(4687,101000370,"0","","太好了，冒险者！你凭借卓越的智慧，战胜了霸王龙巴尔！你的勇气和实力令我惊叹！现在，快开启这份珍贵的宝箱吧！","","Great, adventurer! You defeated Tyrannosaurus Baer with your outstanding wisdom! Your courage and strength amazed me! Now, open this precious treasure chest!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4687] = new Cfg_t_message_s_Info(4688,101000371,"0","","恭喜你冒险者！你终于集齐了所有的飞艇零件！","","Congratulations to you adventurer! You finally gathered all the airship parts!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4688] = new Cfg_t_message_s_Info(4689,101000372,"0","","唉，虽然收集齐了零件，但我还缺乏修理材料，飞空艇还不能正常飞行。","","Alas, although I have collected all the parts, I still lack repair materials and the airship cannot fly normally","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4689] = new Cfg_t_message_s_Info(4690,101000373,"0","","不必担心，冒险者。修理飞艇还需要青铜时代的技术，你可以把主城提升至青铜时代，获取新的技术和资源。","","Don't worry, adventurer Repairing airships also requires Bronze Age technology You can elevate the main city to the Bronze Age and obtain new technologies and resources","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4690] = new Cfg_t_message_s_Info(4691,101000374,"0","","放心吧冒险者，随着领地的不断发展，飞空艇必将再次翱翔于蓝天！现在，让我们来升级主城吧！","","Don't worry adventurers, as the territory continues to develop, the airship will once again soar in the blue sky! Now, let's upgrade the main city!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4691] = new Cfg_t_message_s_Info(4692,101000375,"0","","冒险者，远古之岛的探索已经完成，随着主城的繁荣，领地诞生出了文明的火种。","","Adventurers, the exploration of the ancient island has been completed, and with the prosperity of the main city, the territory has given birth to a spark of civilization","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4692] = new Cfg_t_message_s_Info(4693,101000376,"0","","领地的建设，需要更丰富的资源。你可以通过飞空艇前往更高层的岛屿，开启新的探险。","","The construction of territories requires richer resources You can embark on new adventures by flying airships to higher islands","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4693] = new Cfg_t_message_s_Info(4694,101000377,"0","","出发吧！无论未来面对什么样的困难，我们都会一直陪在你身边，共同守护领地的和平与发展。","","Let's go! No matter what difficulties we may face in the future, we will always be by your side and work together to safeguard the peace and development of our territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4694] = new Cfg_t_message_s_Info(4695,101000378,"0","","这里好热闹，魔兽们正在举办狂欢派对！","","It's so lively here, the Warcraft are holding a carnival party!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4695] = new Cfg_t_message_s_Info(4696,101000379,"0","","快看，冒险者出现了！正好把他绑起来，抓进通天塔，做我们的收藏品。","","Look, the adventurer has appeared! Just tie him up and grab him into the Tongtian Tower to make our collection","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4696] = new Cfg_t_message_s_Info(4697,101000380,"0","","点击“霸王龙”","","Click on 'Tyrannosaurus Rex'","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4697] = new Cfg_t_message_s_Info(4698,101000381,"0","","点击“战斗”按钮","","Click on the 'Battle' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4698] = new Cfg_t_message_s_Info(4699,101000382,"0","","点击“主堡”","","Click on 'Main Castle'","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4699] = new Cfg_t_message_s_Info(4700,101000383,"0","","点击“升级”按钮","","Click on the 'Upgrade' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4700] = new Cfg_t_message_s_Info(4701,101000384,"0","","低于5分钟的建设，可以使用免费升级，直接完成，让我们来试试吧","","Construction that takes less than 5 minutes can be upgraded for free and completed directly Let's give it a try","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4701] = new Cfg_t_message_s_Info(4702,101000385,"0","","点击“升级”按钮","","Click on the 'Upgrade' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4702] = new Cfg_t_message_s_Info(4703,101000386,"0","","本次升级的时间较长，让我们来试试刚刚获得的加速道具吧，再次点击“主堡”按钮","","This upgrade will take a long time Let's try the acceleration item we just obtained and click the \"Main Castle\" button again","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4703] = new Cfg_t_message_s_Info(4704,101000387,"0","","点击“加速”按钮","","Click on the 'Accelerate' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4704] = new Cfg_t_message_s_Info(4705,101000388,"0","","点击”使用加速道具“按钮","","Click on the 'Use Acceleration Prop' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4705] = new Cfg_t_message_s_Info(4706,101000389,"0","","点击“使用”按钮","","Click on the 'Use' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4706] = new Cfg_t_message_s_Info(4707,101000390,"0","","点击“立即修复”按钮","","Click on the 'Repair Now' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4707] = new Cfg_t_message_s_Info(4708,101000391,"0","","让我们移动符文晶石，进行一次消除！","","Let's move the rune crystal and eliminate it once!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4708] = new Cfg_t_message_s_Info(4709,101000392,"0","","晶石消除会产生符文能量，当前你已经拥有6点能量","","Crystal elimination will generate rune energy, and currently you have 6 energy points","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4709] = new Cfg_t_message_s_Info(4710,101000393,"0","","消耗符文能量，可以召唤英灵进入场地战斗，让我们来试试吧！","","Consume rune energy and summon heroes to enter the field for battle Let's give it a try!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4710] = new Cfg_t_message_s_Info(4711,101000394,"0","","划动“英灵”将其部署在战场上","","Move the 'spirit' and deploy it on the battlefield","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4711] = new Cfg_t_message_s_Info(4712,101100001,"0","","太棒了！我们的领土又扩张了！现在，让我们来建造一块农田吧。","","That's great! Our territory has expanded again! Now, let's build a piece of farmland","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4712] = new Cfg_t_message_s_Info(4713,101100002,"0","","小心，这是岛上另一种常见的怪兽，嚣张的三角龙！","","Be careful, this is another common monster on the island, the arrogant VelociTriceratops!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4713] = new Cfg_t_message_s_Info(4714,101100003,"0","","小家伙，我可是不好惹的！实力不够的话，可别来挑衅我！","","Little guy, I'm not easy to mess with! If your strength is not enough, don't provoke me!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4714] = new Cfg_t_message_s_Info(4715,101100004,"0","","在推图模式中，每消除一次符文，就会召唤一名士兵！它们将与你并肩作战。","","In push graphical model, every time you eliminate the rune, you will summon a soldier! They will fight alongside you","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4715] = new Cfg_t_message_s_Info(4716,101100005,"0","","精彩的战斗！现在，让我们利用获胜的资源，进行一轮领地建设吧。","","Exciting battle! Now, let's use the winning resources to carry out a round of territorial construction","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4716] = new Cfg_t_message_s_Info(4717,101100006,"0","","如果建造时间低于5分钟，就可以使用免费升级，立即完成。不要忘记使用哦！","","If the construction time is less than 5 minutes, you can use a free upgrade and complete it immediately Don't forget to use it!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4717] = new Cfg_t_message_s_Info(4718,101100007,"0","","这里有一座怪物营地，它包含了多个危险的关卡。我们需要做好充分的准备，再来挑战。","","There is a monster camp here, which contains multiple dangerous levels We need to be fully prepared before we challenge again","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4718] = new Cfg_t_message_s_Info(4719,101100008,"0","","先跟随主线任务，将兵营提升至2级吧。","","Follow the main task first and elevate the barracks to level 2","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4719] = new Cfg_t_message_s_Info(4720,101100009,"0","","非常好！我们的步兵变得更加强大了！现在正是发动进攻的最佳时机！","","Very good! Our infantry has become even stronger! Now is the best time to launch an attack!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4720] = new Cfg_t_message_s_Info(4721,101100010,"0","","赶紧出发吧，我已经迫不及待了！","","Hurry up and start, I can't wait anymore!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4721] = new Cfg_t_message_s_Info(4722,101100011,"0","","太棒了！我们的领地再次扩张了。让我们先建一座牧场，它能够生产出肥美的鲜肉，让士兵们更加强大。","","That's great! Our territory has expanded again Let's first build a ranch that can produce rich and fresh meat, making soldiers stronger","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4722] = new Cfg_t_message_s_Info(4723,101100012,"0","","接下来，让我们进行骑兵营的建设吧。","","Next, let's proceed with the construction of the cavalry camp","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4723] = new Cfg_t_message_s_Info(4724,101100013,"0","","骑兵拥有卓越的机动性，能够快速接近敌人，对其进行压制。在后续的战斗中，请多多发挥它们的优势！","","Cavalry has excellent mobility and can quickly approach enemies to suppress them In the subsequent battles, please make more use of their advantages!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4724] = new Cfg_t_message_s_Info(4725,101100014,"0","","天哪！这些可恶的魔兽，竟然摧毁了珍贵的祝福之井！那可是月之神赐福的宝贝！","","Oh my goodness! These despicable beasts have destroyed the precious well of blessings! That's a treasure blessed by the Moon God!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4725] = new Cfg_t_message_s_Info(4726,101100015,"0","","祝福之井？","","Well of blessings?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4726] = new Cfg_t_message_s_Info(4727,101100016,"0","","祝福之井深受月之神的眷顾。清澈的泉水蕴含月之神的赐福，能够快速恢复体力，让我们更好的探索岛屿。","","The clear water contains the blessing of the moon God, which will quickly restore our strength and allow us to better explore the island.","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4727] = new Cfg_t_message_s_Info(4728,101100017,"0","","放心吧！我会击败这群魔兽，重新修复好祝福之井！","","Don't worry! I will defeat this group of Warcraft and repair the Well of Blessings!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4728] = new Cfg_t_message_s_Info(4729,101100018,"0","","太棒了，冒险者！祝福之井的力量，能够为您的军队带来新的活力！","","Great, adventurer! The power of the Blessing Well can bring new vitality to your army!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4729] = new Cfg_t_message_s_Info(4730,101100019,"0","","每天的12:00与18:00，你都可以来这里恢复体力。","","You can come here every day at 12:00 and 18:00 to recover your strength","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4730] = new Cfg_t_message_s_Info(4731,101100020,"0","","看！我的飞艇发动机，就在那个宝箱里。我要把它夺回来！","","Look! My airship engine is in that treasure chest I want it back!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4731] = new Cfg_t_message_s_Info(4732,101100021,"0","","先别急，那只危险的飞龙正在看守宝箱。我们需要强大的对空力量，才能战胜它！让我们先建设一座弓兵营吧。","","Don't worry, that dangerous pterosaur is guarding the treasure chest We need strong air force to defeat it! Let's build a bow barracks first","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4732] = new Cfg_t_message_s_Info(4733,101100022,"0","","真是一次大丰收，我们需要建造1个仓库，扩大领地的存储上限，避免资源浪费。","","It's really a Dafengshou (Salad of assorted fresh vegetables) We need to build a warehouse to expand the storage limit of the territory and avoid waste of resources","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4733] = new Cfg_t_message_s_Info(4734,101100023,"0","","河对岸就是熔岩剑齿虎的领地了！我们需要对领地进行一次升级，拥有足够的实力后，再继续探索。","","Across the river is the territory of the Lava Sword Toothed Tiger! We need to upgrade our territory and have sufficient strength before continuing to explore","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4734] = new Cfg_t_message_s_Info(4735,101100024,"0","","那就先从升级主堡开始吧！","","Let's start by upgrading the main castle first!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4735] = new Cfg_t_message_s_Info(4736,101100025,"0","","恭喜你，冒险者！领地的不断壮大，吸引到岛上的众多“英灵”前来相助。","","Congratulations, adventurer! The continuous growth of the territory has attracted numerous \"heroes\" on the island to come to help","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4736] = new Cfg_t_message_s_Info(4737,101100026,"0","","“英灵”？","","Heroes?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4737] = new Cfg_t_message_s_Info(4738,101100027,"0","","英灵是久经沙场的勇士，它们拥有强大的实力和卓越的战技。让我们建设一座“英灵酒馆”，作为它们的落脚点吧！ ！","","Heroes are experienced warriors who possess strong strength and excellent combat skills Let's build a 'Spirit Tavern' as their foothold!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4738] = new Cfg_t_message_s_Info(4739,101100028,"0","","酒馆的等级，决定了英灵成长的上限。要想英灵在战场上发挥更大的作用，一定要先提升英灵酒馆的等级哦！","","The level of the tavern determines the upper limit for the growth of heroes If you want the spirit to play a greater role in the battlefield, you must first upgrade the level of the spirit tavern!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4739] = new Cfg_t_message_s_Info(4740,101100029,"0","","现在，让我们来见识一下英灵的力量吧！","","Now, let's see the power of heroes!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4740] = new Cfg_t_message_s_Info(4741,101100030,"0","","符文的消除能够提供能量，当能量足够后，便可使用英灵协助战斗","","The elimination of runes can provide energy, and when the energy is sufficient, heroes can be used to assist in battles","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4741] = new Cfg_t_message_s_Info(4742,101100031,"0","","召唤英灵至战场","","Summon heroes to the battlefield","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4742] = new Cfg_t_message_s_Info(4743,101100032,"0","","让我们运用英灵的强大力量，来获取胜利吧！","","Let's use the powerful power of heroes to achieve victory!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4743] = new Cfg_t_message_s_Info(4744,101100033,"0","","提升神像的等级，不但能让我在战斗中释放更强大的技能，还能为领地的发展提供更多的增益。","","Raising the level of the idol not only allows me to unleash stronger skills in battles, but also provides more benefits for the development of the territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4744] = new Cfg_t_message_s_Info(4745,101100034,"0","","冒险者，期待你运用光辉的力量，将领地发展得更加强盛。","","Adventurer, we look forward to using your glorious power to develop your territory even stronger","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4745] = new Cfg_t_message_s_Info(4746,101100035,"0","","现在我们拥有了稳定的矿石产出，可以修建暗之神像了。","","Now that we have stable ore production, we can build the Dark God statue","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4746] = new Cfg_t_message_s_Info(4747,101100036,"0","","暗之神像是用来供奉暗夜之神的吗？","","Is the Dark God used to worship the Night God?","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4747] = new Cfg_t_message_s_Info(4748,101100037,"0","","不错，暗夜之神与我是姐妹神。修建暗之神像，可以召唤她的降临！ 相信她的力量，能为我们的领地带来巨大的提升。","","Yes, the god of night and I are sisters gods Build the Dark God statue to summon her arrival! Believe in her power and bring tremendous improvements to our territory","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4748] = new Cfg_t_message_s_Info(4749,101100038,"0","","随着主堡等级的提升，我们能够建造更多种类的资源建筑了。在建造的同时，不要忘记领地的扩张哦。","","With the improvement of the main castle level, we are able to build more types of resource buildings Don't forget to expand your territory while building","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4749] = new Cfg_t_message_s_Info(4750,101100039,"0","","神像等级提升了，我也恢复了更多的力量。如果你想要了解发生了哪些变化，就通过神像建筑来查看吧。","","The level of the idol has increased, and I have also regained more strength If you want to understand what changes have occurred, check it out through the statue building","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4750] = new Cfg_t_message_s_Info(4751,101100040,"0","","在交易所中，你可以进行稀有卡牌的交易。快来逛一逛，获取你心仪的卡牌吧！","","In the exchange, you can trade rare cards Come and take a look and get your favorite card!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4751] = new Cfg_t_message_s_Info(4752,101100041,"0","","纪念碑上记录着冒险者们的丰功伟绩，困难的挑战与领地的发展，都会记录于此。当你完成纪念碑上的成就时，就能获得丰厚的奖励。加油吧，尊敬的冒险者大人！","","The monument records the great achievements, difficult challenges, and territorial development of adventurers When you complete the achievements on the monument, you will receive generous rewards Come on, respected adventurer!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4752] = new Cfg_t_message_s_Info(4753,101100042,"0","","很好，稳定的粮食产出是提升步兵战斗力的前置条件","","Good, stable food output is a prerequisite for improving infantry combat effectiveness","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4753] = new Cfg_t_message_s_Info(4754,101100043,"0","","让我们再建造一座步兵营吧，注意选择一个可使用的区域哦。","","Let's build another infantry battalion and choose a usable area","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4754] = new Cfg_t_message_s_Info(4755,101100044,"0","","非常好，步兵营建设成功，让我们继续岛屿的探索吧！","","Very good, the infantry battalion has been successfully constructed Let's continue exploring the island!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4755] = new Cfg_t_message_s_Info(4756,101100045,"0","","点击“征战”按钮，可快速切换至任务地点，快试试吧！","","Click on the 'Campaign' button to quickly switch to the mission location Give it a try!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4756] = new Cfg_t_message_s_Info(4757,101100046,"0","","点击“英灵”卡牌","","Click on the 'Spirit' card","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4757] = new Cfg_t_message_s_Info(4758,101100047,"0","","点击“上阵”按钮","","Click on the 'Go to battle' button","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4758] = new Cfg_t_message_s_Info(4759,101100048,"0","","将其他的“英灵”卡牌也部署到队伍之中，让敌人见识见识我们的力量吧","","Deploy other 'Spirit' cards to the team as well, so that the enemy can see our strength","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4759] = new Cfg_t_message_s_Info(4760,101100049,"0","","您就是预言中的冒险者大人吗！请您救救我，打败剑齿虎吧。","","Are you the adventurer in prophecy! Please help me and defeat the sabretooth","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4760] = new Cfg_t_message_s_Info(4761,101100050,"0","","哼，从哪儿冒出来的小家伙？竟敢打扰我的好事！看我不揍扁你！","","Hmm, where did that little guy come from? How dare you disturb my good deed! See if I don't beat you up!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4761] = new Cfg_t_message_s_Info(4762,101100051,"0","","哎呦！好痛好痛！就算你们赢了我！也无法突破后面的魔兽封锁！等着吧！","","Ouch! It hurts so much! Even if you win against me! We can't break through the Warcraft blockade behind us! Wait!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4762] = new Cfg_t_message_s_Info(4763,101100052,"0","","尊敬的冒险者大人，非常感谢您救了我。这些宝贝都给您吧！","","Dear Adventurer, thank you very much for saving me Here are all these treasures for you!","","","","","","","","","","","","","","","","","","","","","","","","","",""),
	[4763] = new Cfg_t_message_s_Info(4764,102000001,"0","","亲爱的玩家朋友：\n\n\u3000欢迎来到《文明爱消除》的世界！\n\n\u3000《文明爱消除》将于将在2023年3月1日正式上线。\n\n\u3000届时，将开启新服务器——英灵圣殿，勇者之心。欢迎广大玩家的参与。\n\n\u3000亲爱的冒险家们，精彩的探险旅程即将开始。
\n\u3000快进入游戏，尽情享受文明的盛宴吧！","","Dear player friends:\n\n\u3000Welcome to the world of Civilization Love Elimination!!\n\n\u3000Civilization Love Elimination will be officially launched on March 1, 2023\n\n\u3000At that time, a new server will be opened-the Holy Spirit Temple, the Heart of the Brave Players are welcome to participate\n\n\u3000Dear adventurers, a wonderful adventure is about to begin","","","","","","","","","","","","","","","","","","","","","","","","","",""),
